pragma solidity ^0.4.24;

import "openzeppelin-eth/contracts/math/SafeMath.sol";
import "openzeppelin-eth/contracts/ownership/Ownable.sol";
import "./GOPCreator.sol";
import "./usingOraclize.sol";
import "zos-lib/contracts/Initializable.sol";

contract FoundationAuctions is Initializable, Ownable, usingOraclize {
    using SafeMath for uint256;

    uint256[] public foundationAuctionsList;
    uint256[] public openAuctions;

    // * We're using GOPCreator instead of Core directly because we have both contract's functions available.
    GOPCreator gop;

    struct Foundation {
        uint256 createdAt;
        uint256 maxBid;
        uint256 minimum;
        uint256 horseBatch;
        uint256 firstBidTime;

        address maxBidder;
        address[] bidders;

        bool isOpen;

        string horseHash;

        bytes32 horseGender;

        mapping(address => uint256) bids; // Maps each address on this auction to a bid.
        mapping(address => uint256) bidTimes; // Maps each address on this auction to a bid time.
        mapping(address => bool) exists;
    }

    mapping(uint256 => Foundation) internal foundationAuctions;
    mapping(address => uint256[]) internal auctionsParticipating;
    mapping(uint256 => uint256) internal auctionIndex;

    event AuctionCreated(address _creator, uint256 _auctionId, uint256 _time);
    event Bid(address _bidder, uint256 _amount, uint256 _time);
    event HorseWithdraw(address _claimer, uint256 _horseId, uint256 _time);
    event Payout(address _claimer, uint256 _amount, uint256 _time);
    event AuctionCancel(address _owner, uint256 _auctionId, uint256 _time);

    function initialize(address _gopAddr, address _owner) public initializer {
        Ownable.initialize(_owner);
        gop = GOPCreator(_gopAddr);
        // OAR = OraclizeAddrResolverI(0x6f485C8BF6fc43eA212E93BBF8ce046C7f1cb475);
    }

    /*
    @dev Creates a Foundation Stable auction. We use '_genotype' to identify the genotype of the horse
    we're going to create and it also helps us check horses remaining for a specific batch.
    */
    function createFoundationAuction(uint256 _genotype, bytes32 _gender, string _horseHash) public payable onlyOwner() {
        // We need to meet horse's limits.
        require(gop.horsesRemaining(_genotype) > 0, "Genotype limit reached");
        require(msg.value >= oraclize_getPrice("URL"), "Oraclize price not met");

        uint256 amount;

        if(_genotype == 5) amount = 0.185 ether;
        if(_genotype == 6) amount = 0.18 ether;
        if(_genotype == 7) amount = 0.175 ether;
        if(_genotype == 8) amount = 0.17 ether;
        if(_genotype == 9) amount = 0.165 ether;
        if(_genotype == 10) amount = 0.16 ether;

        uint256 auctionId = foundationAuctionsList.push(1);

        Foundation memory auction;
        auction.createdAt = now;
        auction.minimum = amount;
        auction.horseBatch = _genotype;
        auction.isOpen = true;
        auction.horseGender = _gender;
        auction.horseHash = _horseHash;

        foundationAuctions[auctionId] = auction;

        uint256 index = openAuctions.push(auctionId) - 1;
        auctionIndex[auctionId] = index;

        emit AuctionCreated(msg.sender, auctionId, now);
    }

    // Creates a bid for an user on an auction.
    function foundationAuctionBid(uint256 _auctionId) public payable {
        Foundation storage a = foundationAuctions[_auctionId];
        uint256 userBid = a.bids[msg.sender].add(msg.value);

        require(a.isOpen, "auctionClosed");
        require(msg.sender != owner(), "cantBeOwner");

        // Bid must be greater than minimum & maxBid.
        require(msg.value >= a.minimum, "bidLowerThanMinimum"); // if this is not the first bid it should always be greater than the minimum.
        require(userBid > a.maxBid, "bidLowerThanMaximumBid");

        if(a.bidders.length == 0) {
            // If this is the first bid we're going to send the oraclize query here.
            string memory url = "json(https://api.zed.run/api/v1/close_auction).auction_closed";
            string memory payload = strConcat("{\"auction\":", uint2str(_auctionId), "}");

            // Default is one day after first bid.
            oraclize_query(86400, "URL", url, payload);

            a.firstBidTime = now;
        }

        a.bids[msg.sender] = userBid;
        a.bidTimes[msg.sender] = now;

        if(!a.exists[msg.sender]) {
            a.bidders.push(msg.sender);
            a.exists[msg.sender] = true;

            auctionsParticipating[msg.sender].push(_auctionId);
        }

        a.maxBid = userBid;
        a.maxBidder = msg.sender;

        emit Bid(msg.sender, userBid, now);
    }

    /*
    @dev Withdraws something from the auction depending on who's calling the transaction.
    1. If you're the 'owner' you will claim the maxBid.
    2. If you're the maxBidder you're going to claim the prize (Mint a token)
    3. Anything else will claim their bid on the auction.
    */
    function foundationAuctionWithdraw(uint256 _auction) public returns(bool) {
        // 'owner' doesn't get anything from here.
        Foundation storage a = foundationAuctions[_auction];

        require(!a.isOpen, "auctionOpen");

        // Transfer a token for 'maxBidder'.
        if(msg.sender == a.maxBidder) {
            // // Mint the token.
            uint256 horseId = gop.createCustomHorse(msg.sender, a.horseHash, a.horseBatch, a.horseGender);

            delete a.maxBidder;

            emit HorseWithdraw(msg.sender, horseId, now);

            return true;
        }

        // Transfer 'maxBid' to the owner.
        if(msg.sender == owner()) {
            msg.sender.transfer(a.maxBid);

            emit Payout(msg.sender, a.maxBid, now);

            delete a.maxBid;

            return true;
        }

        // Sends money back to user if they didn't win.
        if(msg.sender != a.maxBidder && msg.sender != owner()) {
            msg.sender.transfer(a.bids[msg.sender]);

            emit Payout(msg.sender, a.bids[msg.sender], now);

            delete a.bids[msg.sender];

            return true;
        }
    }

    function __callback(bytes32 _id, string _result) public {
        require(msg.sender == oraclize_cbAddress(), "notOraclize");

        uint256 auctionId = parseInt(_result);
        Foundation storage a = foundationAuctions[auctionId];

        // Evaluate if we should be able to cancel auctions from this contract.
        _removeAuction(auctionId);
        a.isOpen = false;
    }

    // Gives a way for the owner to cancel a given auction.
    function cancelAuction(uint256 _auctionId) public onlyOwner() {
        _removeAuction(_auctionId);
        foundationAuctions[_auctionId].isOpen = false;

        emit AuctionCancel(msg.sender, _auctionId, now);
    }

    /*
    @dev returns common data for a given auction.
    */
    function getAuction(uint256 _auctionId)
    public
    view
    returns(uint256, uint256, uint256, uint256, uint256, address, address[], bool, string, bytes32) {
        Foundation memory a = foundationAuctions[_auctionId];

        return(
            a.createdAt,
            a.maxBid,
            a.minimum,
            a.horseBatch,
            a.firstBidTime,
            a.maxBidder,
            a.bidders,
            a.isOpen,
            a.horseHash,
            a.horseGender
        );
    }

    /*
    Returns bid data for a given address on a given auction.
    */
    function getBidData(uint256 _auctionId, address _bidder) public view returns(uint256, uint256) {
        Foundation storage a = foundationAuctions[_auctionId];

        return(a.bids[_bidder], a.bidTimes[_bidder]);
    }

    function getOpenAuctions() public view returns(uint256[]) {
        return openAuctions;
    }

    // RESTRICTED
    function _removeAuction(uint256 _tokenId) private {
        uint256 index = auctionIndex[_tokenId];
        uint256 lastAuctionIndex = openAuctions.length.sub(1);
        uint256 lastAuction = openAuctions[lastAuctionIndex];

        openAuctions[index] = lastAuction;
        auctionIndex[lastAuction] = index;

        delete openAuctions[lastAuctionIndex];

        openAuctions.length--;
    }

    function setGOPCreator(address _gop) public onlyOwner() {
        gop = GOPCreator(_gop);
    }
}
